import React, {Component} from "react";

class MemeGenerator extends Component {
    constructor () {
        super();
        this.state = {
            topText: "",
            bottomText: "",
            randomImage: "http://i.imgflip.com/1bij.jpg"
        }
    }
    render() {
        return (
            <div className="MemeGenerator">
                <img src={this.state.randomImage}></img>
            </div>
        )
    }
}

export default MemeGenerator;
